import Head from 'next/head';

export default function Meta() {
  return (
    <Head>
      <meta
        name="description"
        content={`A personal website and blog for Tepy Thai`}
      />
      <meta property="og:image" content={'/favicon/og-image.svg'} />
    </Head>
  );
}
